If we ignore suffering, we encourage suffering.

Although this was trip number six to Berlin, never have I felt so aware of the cost of staying silent to the oppression of others.

This single white carnation, fading in the sun, a contrast to the concrete blocks of the Holocaust Memorial (Memorial to the Murdered Jews of Europe) -- and almost bleeding over the sides is packed with a lot of deep meaning for me.

I saw it as we were walking into the memorial, and this simple act of respect & remembrance left by a stranger - but not because we are all one human family - touched my heart and my creative eye. Only now in posting it am I getting its full, joy? Is that the right word.

